import {FETCH_MALLS} from "../actions/types";
  
const initialState = {
    all_malls: [],
  };
  
const reducer = (state = initialState, action) => {
    switch (action.type) {
        case FETCH_MALLS:
            return {
                    ...state,
                    all_malls: action.payload,
            };
        default:
            return state;
    }
};
export default reducer;
